import sys

def get_dinner_guests():
    dinner_guests = ['Albert Einstein', 'Ada Lovelace', 'Albert Camus', 'Gandhi', 'Pablo Picasso', 'Alberti', 'Bohr', 'Leonardo da Vinci', 'Da Vinci', 'Heisenberg', 'Sartre']
    num_guests = int(input("How many guests? "))

    if num_guests > len(dinner_guests):
        print("That's too many guests!")
        sys.exit()

    guests = []
    for i in range(num_guests):
        guest = dinner_guests.pop()
        guests.append(guest)

    return guests

def main():
    dinner_guests = get_dinner_guests()
    print("Invited dinner guests:")
    for guest in dinner_guests:
        print(guest)

if __name__ == "__main__":
    main()

