import time

def minimise_leftover_sheets(sheets, person_demands, profile):
    attending_sheets = []
    for i, demand in enumerate(person_demands):
        if demand not in attending_sheets:
            attending_sheets.append(demand)
        attending_sheets = sorted(attending_sheets)
        attending_sheets = attending_sheets[1:]
    return attending_sheets

