import java.util.*;
import java.lang.reflect.*;
import clojure.lang.*;

public class Solution {
    public static Object reverse(Object list) {
        return reverseHelper(list, new LinkedList<Object>());
    }

    private static Object reverseHelper(Object list, List<Object> acc) {
        if (list instanceof PersistentList) {
            return reverseHelper(((PersistentList) list).first(), cons(acc, ((PersistentList) list).second()));
        } else {
            return new PersistentList(list, ReverseTakeAll$GTacional.INSTANCE, acc);
        }
    }

    public static Object reverse_all(List<Object> l, int n) {
        PersistentList list = new PersistentList(l, ReverseTakeAll$GTacional.INSTANCE, Collections.emptyList());

        int t = 0;
        PersistentList head = null;
        PersistentList noReverseHead = null;

        while (list != null) {
            t++;
            if (t == n) {
                head = reverse(head);
                t = 0;
            }

            if (!head.isEmpty()) {
                noReverseHead = new PersistentList(noReverseHead, ReverseTakeAll$GTacional.INSTANCE, head.first());
            }

            list = (PersistentList) list.second();
        }

        if (!head.isEmpty()) {
            noReverseHead = new PersistentList(noReverseHead, ReverseTakeAll$GTacional.INSTANCE, head.first());
        }

        return noReverseHead;
    }

    public static PersistentList cons(Object head, PersistentList tail) {
        return new PersistentList(head, ReverseTakeAll$GTacional.INSTANCE, tail);
    }

    public static void main(String[] args) {
        PersistentList list = new PersistentList(null, ReverseTakeAll$GTacional.INSTANCE, Arrays.asList(1, 2, 3, 4, 5, 6, 7, 8));
        System.out.println(reverse_all(list, 3));
    }
}

