One way to identify paraphrases is to use heuristic rules. For example, consider the following paraphrase:
 car -> automobile
This paraphrase is created by substituting the word "car" with "automobile". The two words are synonyms and can be used interchangeably in most contexts.
To detect this paraphrase using heuristics, we can compare the two words using a tokenizer to split them into individual characters. We can then compare the characters one by one to ensure that they are identical in both words.
Here is an example implementation in Python:
import jieba
def are_paraphrases(text1, text2):
    t1 = set(text1)
    t2 = set(text2)
    return t1 == t2
def heuristic detection(text1, text2):
    if are_variations(text1, text2):
        return True
    if are_parallel(text1, text2):
        return True
    if are_variations(text2, text1):
        return True
    return False
def are_variations(text1, text2):
    return are_equal(text1, text2) or are_permutations(text1, text2)
def are_parallel(text1, text2):
    t1 = set(text1)
    t2 = set(text2)
    return t1 == t2
