from django.shortcuts import render
from django.views.decorators.csrf import csrf_exempt

@csrf_exempt
def handle_pjs(request):
    index = 0
    pjs = request.GET.getlist('pjs[]')
    html = ''
    for pj in pjs:
        html += '<p style="background-color: white; padding: 10px;">'
        html += pj
        html += '</p>'
        index += 1
    return render(request, 'pjs.html', {'pjs': pjs, 'html': html})

