import os

def cat(filename):
    with open(filename) as f:
        return f.read()

def get_filelist(path):
    filelist = []
    for root, _, files in os.walk(path):
        for f in files:
            filelist.append(os.path.join(root, f))
    return filelist

def copy(src, dst):
    with open(src) as f:
        data = f.read()
    with open(dst, 'w') as f:
        f.write(data)

