from flask import Flask, request

app = Flask(__name__)

changes = [{'line': 12, 'change':'Normalize space'},
            {'line': 15, 'change':'add try/except'},
            {'line': 22, 'change':'return fstring'},
            {'line': 30, 'change':'add shortcut for res'},]

@app.route('/update', methods=['POST'])
def parse_request():
    code = request.get_json()['code']
    for change in changes:
        index = change['line'] - 1
        code = code[:index] + change['change'] + code[index:]
    return 'Successfully synthesized the change!')

if __name__ == '__main__':
    app.run()

